import React, { useState } from 'react'
import { Box, Tabs, Tab} from '@mui/material';
import PropTypes from 'prop-types';
import { Button } from "reactstrap";
import InputAdornment from '@mui/material/InputAdornment';
import TextField from '@mui/material/TextField';
import "./sell.css"

TabPanel.propTypes = {
     children: PropTypes.node,
     index: PropTypes.number.isRequired,
     value: PropTypes.number.isRequired,
};

function TabPanel(props) {
     const { children, value, index, ...other } = props;
   
     return (
       <div
         role="tabpanel"
         hidden={value !== index}
         id={`simple-tabpanel-${index}`}
         aria-labelledby={`simple-tab-${index}`}
         {...other}
       >
         {value === index && (
           <Box sx={{ p: 3 }}>
             <div>{children}</div>
           </Box>
         )}
       </div>
     );
   }

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

const SaleHistory = () => {
     const [value, setValue] = useState(0);

     const handleChange = (event, newValue) => {
          setValue(newValue);
     };

     return(
          <div className='OpenClose'>
               <div>
                    <h2>Sales History</h2>
               </div>
                    
               <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                  <Tabs value={value} onChange={handleChange} TabIndicatorProps={{style: {background:'green', color: 'green'}}}>
                    <Tab label="By Quantity" {...a11yProps(0)} />
                    <Tab label="By Revenue" {...a11yProps(1)} />
                  </Tabs>
                </Box>
                <TabPanel value={value} index={0}>
                    Item One                  
                </TabPanel>
                <TabPanel value={value} index={1}>
                  Item Two
                </TabPanel>

               <div className='OpenCloseHeader'>
                    <div><p>Set an opening float to open the register and make a sale.</p></div>
               </div>
               <div className='OpenCloseBody'>
                    <div className='OpenCloseBody-child'>
                         
                    </div>
               </div>
          </div>
     )
}
export default SaleHistory;
